export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {}
  }
  render() {
    return (
      <div className="App">
        <div style={{flexDirection: 'row'}}>
          <input type="radio" value="3" name="3" /> 3
          <input type="radio" value="6" name="6" /> 6
          <input type="radio" value="12" name="11" selected={true} /> 12
        </div>
      </div>
    );
  }
}
